import style from "./Login.module.css";

const Login = () => {
  return (
    <div className={style.mainContainer}>
      <form>
        <label>User</label>
        <input />
        <label>Password</label>
        <input />
        <button type="submit">Login</button>
      </form>
    </div>
  );
};

export default Login;
